create table songs
(
    id             int unsigned auto_increment
        primary key,
    title          varchar(255) null,
    analyzed       tinyint(1)   null,
    status         varchar(255) null,
    `key`          varchar(255) null,
    scale          varchar(255) null,
    bpm            double       null,
    energy         double       null,
    happy          double       null,
    sad            double       null,
    aggressiveness double       null,
    danceability   double       null,
    relaxed        double       null,
    path           varchar(255) null,
    slug           varchar(255) null,
    related_songs  varchar(255) null,
    extension      varchar(255) null,
    genre          json         null,
    author         varchar(255) null,
    image          varchar(255) null,
    source         varchar(255) null,
    link           varchar(255) null,
    played         tinyint(1)   null,
    comment        varchar(255) null,
    created_at     datetime(6)  null,
    updated_at     datetime(6)  null,
    created_by_id  int unsigned null,
    updated_by_id  int unsigned null,
    constraint songs_created_by_id_fk
        foreign key (created_by_id) references admin_users (id)
            on delete set null,
    constraint songs_updated_by_id_fk
        foreign key (updated_by_id) references admin_users (id)
            on delete set null
)
    auto_increment = 308;

